Create database UniversidadDB;
use UniversidadDB;

-- Tabla de estudiantes
CREATE TABLE Estudiante (
    EstudianteID INT PRIMARY KEY AUTO_INCREMENT,
    Nombre VARCHAR(100),
    Apellido VARCHAR(100),
    FechaNacimiento DATE,
    Email VARCHAR(100),
    DepartamentoID INT
);

-- Tabla de departamentos
CREATE TABLE Departamento (
    DepartamentoID INT PRIMARY KEY AUTO_INCREMENT,
    Nombre VARCHAR(100)
);

-- Tabla de profesores
CREATE TABLE Profesor (
    ProfesorID INT PRIMARY KEY AUTO_INCREMENT,
    Nombre VARCHAR(100),
    Apellido VARCHAR(100),
    Email VARCHAR(100),
    DepartamentoID INT
);

-- Tabla de cursos
CREATE TABLE Curso (
    CursoID INT PRIMARY KEY AUTO_INCREMENT,
    Nombre VARCHAR(100),
    Creditos INT,
    DepartamentoID INT
);

-- Tabla de clases (quién enseña qué curso)
CREATE TABLE Clase (
    ClaseID INT PRIMARY KEY AUTO_INCREMENT,
    CursoID INT,
    ProfesorID INT,
    Año INT,
    Semestre VARCHAR(20)
);

-- Tabla de inscripciones
CREATE TABLE Inscripcion (
    InscripcionID INT PRIMARY KEY AUTO_INCREMENT,
    EstudianteID INT,
    ClaseID INT,
    FechaInscripcion DATE
);

-- Tabla de calificaciones
CREATE TABLE Calificacion (
    CalificacionID INT PRIMARY KEY AUTO_INCREMENT,
    InscripcionID INT,
    Nota DECIMAL(4,2)
);

